<?php
/**
 * Standard select field.
 *
 * @supports "data_delegate"
 * @args
 *     'options'     => array Array of options to show in the select, optionally use data_delegate instead
 *     'allow_none'   => bool|string Allow no option to be selected (will place a "None" at the top of the select)
 *     'multiple'     => bool whether multiple can be selected
 *
 * @since 1.0.0
 *
 * @extends CMB_Field
 *
 * @package WordPress
 * @subpackage Custom Meta Boxes
 */

class CMB_Icons extends CMB_Field {

	/**
	 * CMB_Select constructor.
	 */
	public function __construct() {

		$args = func_get_args();

		call_user_func_array( array( 'parent', '__construct' ), $args );

	}

	/**
	 * Get default arguments for field including custom parameters.
	 *
	 * @return array Default arguments for field.
	 */
	public function default_args() {
		return array_merge(
			parent::default_args(),
			array(
				'options'         => array(),
				'multiple'        => false,
				'select2_options' => array(),
				'allow_none'      => false,
			)
		);
	}

	/**
	 * Ensure values are saved as an array if multiple is set.
	 */
	public function parse_save_values() {

		if ( isset( $this->parent ) && isset( $this->args['multiple'] ) && $this->args['multiple'] ) {
			$this->values = array( $this->values );
		}

	}

	/**
	 * Get options for field.
	 *
	 * @return mixed
	 */
	public function get_options() {

		if ( $this->has_data_delegate() ) {
			$this->args['options'] = $this->get_delegate_data();
		}

		return $this->args['options'];
	}

	/**
	 * Enqueue all scripts required by the field.
	 *
	 * @uses wp_enqueue_script()
	 */
	public function enqueue_scripts() {

		parent::enqueue_scripts();

		wp_enqueue_script( 'select2', trailingslashit( CMB_URL ) . 'js/vendor/select2/select2.js', array( 'jquery' ) );
		wp_enqueue_script( 'field-select', trailingslashit( CMB_URL ) . 'js/field.select.js', array( 'jquery', 'select2', 'cmb-scripts' ), CMB_VERSION );
	}

	/**
	 * Enqueue all styles required by the field.
	 *
	 * @uses wp_enqueue_style()
	 */
	public function enqueue_styles() {

		parent::enqueue_styles();

		wp_enqueue_style( 'select2', trailingslashit( CMB_URL ) . 'js/vendor/select2/select2.css' );
	}

	/**
	 * Print out field HTML.
	 */
	public function html() {

		if ( $this->has_data_delegate() ) {
			$this->args['options'] = $this->get_delegate_data();
		}

		$this->output_field();

		$this->output_script();
		$this->output_field_Style();
	}

	/**
	 * Compile field HTML.
	 */
	public function output_field() {

		$val = (array) $this->get_value();

		$name = $this->get_the_name_attr();
		$name .= ! empty( $this->args['multiple'] ) ? '[]' : null;

		$none = is_string( $this->args['allow_none'] ) ? $this->args['allow_none'] : __( 'None', 'cmb' );
		$icons = $this->Icons();
		$valinput = !empty($this->get_value()) ? $this->get_value() : "icofont-brand-tango";
		?>

		<div class="permActiveIcon activeiconI" id="activeiconId" status="close">
			<input type="hidden" id="inputiconVal" <?php printf( 'name="%s"', esc_attr( $name ) ); ?> value="<?php echo esc_attr( $valinput ); ?>">
			<i class="<?php echo $valinput; ?> " id="inputiconValic" status="close"> <i class="icofont-rounded-down right-icondwon"></i></i>
		</div>
		<ul
			<?php $this->id_attr(); ?>
			<?php $this->boolean_attr(); ?>

			<?php printf( 'data-field-id="%s" ', esc_attr( $this->get_js_id() ) ); ?>
			<?php echo ! empty( $this->args['multiple'] ) ? 'multiple' : '' ?>
			<?php $this->class_attr( 'SelectIconAreaMetaBox' ); ?>
			 style="display:none; "

		>

			<?php if ( $this->args['allow_none'] ) : ?>
				<li value=""><?php echo esc_html( $none ); ?></li>
			<?php endif; ?>

			<?php /* foreach ( $icons as  $name => $value ) : ?>
				<?php if($valinput == $value){
					$classicon = "listIcons activeicon";
				}else{
					$classicon = "listIcons";
				} ?>

			<?php endforeach; */ ?>
			<button onclick="printIcons();" id="morebtnid" class="moreiconbtn">Load More Icons</button>
		</ul>

		<?php
	}

	/**
	 * Output inline scripts to support field.
	 */
	public function output_script() {

		$options = wp_parse_args( $this->args['select2_options'], array(
			'placeholder' => __( 'Type to search', 'cmb' ),
			'allowClear'  => true,
		) );

		?>

		<script type="text/javascript">
		var icons = "";
			(function($) {
				var is_printed = 0;
				$("body").on("click",".activeiconI",function(){
					var status = $(this).attr("status");
					if(status == 'close'){
						$(this).attr("status","open");
						$(".SelectIconAreaMetaBox").slideDown( "slow" );
					}else{
						$(this).attr("status","close");
						$(".SelectIconAreaMetaBox").hide( "slow" );
					}
				});

				$(".SelectIconAreaMetaBox").on("click",".listIcons",function(){
					var newclass = $(this).attr("classid");
					$("#inputiconVal").val(newclass);
					$('#inputiconValic').attr('class', newclass +' activeiconI');
					console.log(newclass);
				});
					 icons = '<?php echo json_encode($this->Icons()); ?>';



			})( jQuery );
			var end = 0;
			function printIcons(){
				$("#morebtnid").remove();
				var iconsjson = jQuery.parseJSON(icons);
				var valenow   = $("#inputiconVal").val();
				var v = true;
				var doData = 100;
				for(var i=end;i<iconsjson.length && v == true;i++){
					if(doData <= 0){
						v = false;
						end = i;
					}else{
						if(iconsjson[i] == valenow){
							var classicon = "listIcons activeicon";
						}else{
							var classicon = "listIcons";
						}
						var htmlnew = '<li class="'+classicon+'"  classid="'+iconsjson[i]+'" ><i class="'+iconsjson[i]+'"></i></li>';
						$(".SelectIconAreaMetaBox").append(htmlnew);

						doData--;
				}


			}

			if(i<iconsjson.length){
				$(".SelectIconAreaMetaBox").append('<button onclick="printIcons();" id="morebtnid" class="moreiconbtn">Load More Icons</button>');
			}
			console.log(end);
				return iconsjson;
		}
		printIcons();
		</script>

		<?php
	}

